import React from "react";
import OneBook from "./OneBook";

const BookHolder = ({ booksB, books }) => {
  const myBooks = booksB.map((bb) => {
    books.map((book) => {
      if (bb.id === book.id) {
        bb.shelf = book.shelf;
      }
      return bb;
    }

    );
  });
  return (
    <div>
      <OneBook books={myBooks} />
    </div>
  );
};

export default BookHolder;
